} Next we see that we're returning our CountEvent struct in our init_counter method. This returned struct will be made available in the data property of the ReturnData receipt. Read more about receipts here . abi Counter { #[storage(write, read)] fn init_counter(value: u64) -> CountEvent; #[storage(read)] fn get_count() -> AnotherCountEvent; #[storage(write, read)] fn increment_counter(value: u64) -> CountEvent;
